        <div class="row counters">

          <div class="col-lg-6 col-6 text-center">
            <span data-purecounter-start="0" data-purecounter-end="1232" data-purecounter-duration="1" class="purecounter">10</span>
            <p>Students</p>
          </div>

          <div class="col-lg-6 col-6 text-center">
            <span data-purecounter-start="0" data-purecounter-end="64" data-purecounter-duration="1" class="purecounter">100</span>
            <p>Courses</p>
          </div>


        </div>

      </div>
    </section>
    </>
  )
}

export default Home






